		"text": "솔까말 어느 정도 '끕' 이상의 호텔에는 가족단위로 오는 다른 투숙객들이 많아서, 격하게 떡치기가 좀 그래… 푹 쉬러 가는 것이 아니라 떡을 주 목적으로 가는 것이라면 고급 호텔보다는 적당한 급의 부티크 호텔이나 괜찮은 모텔이 더 낫다고 생각",
