		"text": "사회적 약자가 범죄의 피해자라고 해서 당 범죄가 자동적으로 학술/실무상 혐오범죄로 분류되지는 않아요. 혐오범죄 해당성은 해당 범행이 행위자의 혐오나 차별 등의 신념에서 비롯되었는지 등을 따져 볼 필요가 있죠. https://t.co/mLAjRpqLio",
