			"text": "연수원 동기가 고승덕, 조영래, 박원순.\n차석인데도 판사임용 안시켜줘서 부산에서 법률사무소 열었는데 그 때 만난 게 노무현.\n노무현 정부에서 민정수석 맡고 1년만에 이빨 다빠져서 히말라야 갔다가 탄핵뉴스 보고 바로 귀국해서 변호.\n...그냥 먼치킨임",
