		"geo": {},
		"id_str": "840871558956572676",
		"text": "박씨 따라가는 언론사 생중계 보고 있는데, 언론사 취재차량들 완전 무법이네… 오토바이나 차량으로 따라가면서 왜 버스전용차로를 넘나들고, 차선이나 신호위반을 수시로 해. 경찰 경호차량이 거기로 간다고, 취재차량이 그 루트를 똑같이 따라가면 안되지 않나;",
