		"text": "근데 사저(私邸)의 사전적 의미가 \"개인의 저택. 또는 고관(高官)이 사사로이 거주하는 주택을 관저에 상대하여 이르는 말\" 아닌가. 관저에 상대되는 개념으로 고관(高官)이 사사로이 거주하는 주택이란 의미가 있지만, 개인의 저택에도 쓸 수 있다고 보는데",
