		"id_str": "840443879774072832",
		"text": "RT @niro2017: 교수님: 주절주절 그렇지만 여러분 이런 정치 환경에는 여러분의 책임도 있습니다 여러분이 뽑은 대통령인거에요\n우리(15학번): 아니에요! 저희는 그때 고등학생이여서 투표권도 없었다고요 진자 (다들소리지름)\n교수님: 여러분 그…",
