		"text": "RT @cailia: 인터넷에서 무언가를 비판할때는\n\n\"우범 지역에 술에 꼴아서 쓰러져 자고 있으면 범죄에 노출될 가능성이 높으니 조심해야 한다\"\n\n라고 글을 쓰면 \"범죄를 저지르는 범죄자가 잘못이지 왜 피해자가 조심해야 하느냐\"\n\n라는 반박이 들어…",
