		"text": "슬프게도 \"한국 남성이 존재하지 않으면 수요도 존재하지 않는다\"거나, \"성매매를 하는 한국남성으로 인해 성매매가 생겨나는 것\"은 아니어요. '주요 수요자'라는 말이 시장을 '발생'시킨다는 의미는 아니어요 @dreamypath @circuit__star https://t.co/vX0PmjB1oF",
