		"text": "이게 美국무부의 “2010 인신매매보고서(https://t.co/GYJzfp41Qp)\"인데, 대체 거기 어디에 \"…the men of South Korea create demand for child sex tourism…\" 이라는 문구가 있음? https://t.co/ALj1URYjdY",
