		"geo": {},
		"id_str": "838797220388339713",
		"text": "이씨발 나도 참여한 연구보고서를 지들 입맛대로 주작하는데, 내가 꼭지가 돌겠냐 안돌겠냐",
		"id": 838797220388339700,
