		"geo": {},
		"id_str": "838796979480084480",
		"in_reply_to_user_id": 95255804,
		"text": "제발 부탁인데, 자질 없으신 분들은 셀프 오역하거나 입맛대로 조작해서 인용하지 마시고- 번역 전문가에게 돈 주고 번역 맡기시거나 해당 분야 전문가가 쓴 논문을 있는 그대로 복붙하세요. 레퍼런스라고 제시했지만, 레퍼런스 없고 뇌피셜에 기반한 주장입니다.",
