		"id_str": "838795766621577216",
		"in_reply_to_user_id": 95255804,
		"text": "그래놓고는 당당하게 \"미 국무부와 한국 형사정책연구원이 밝혔습니다.\"식으로 레퍼런스를 밝히지만, 그 레퍼런스들에는 그런 내용 없다. 해당 레퍼런스들은 '한국남성은 동남아 아동성매매 관광의 주요 수요자/고객으로 지목되고 있다'는 정도로만 지적하고 있음.",
