		"text": "누누이 강조하지만, 아무리 멀쩡한 레퍼런스라도 그걸 인용하는 사람의 자질에 따라 얼마든지 편집되고 조작될 수 있습니다. 자기 필요한 단어만 ctrl + F로 검색한 뒤에 문장들 조합해서 새로운 문장 만들고, 오역해서 새로운 의미로 만드는 경우가 다반사",
