		"text": "예비군훈련 참석 때문에 바쁠 때 눈치 보면서 자리 비우고, 법 무시하고 예비군훈련으로 인한 결근을 연차로 처리하는 개념없는 직장도 있고, 개인사업자들 같은 경우에는 하루 수익 포기하고 예비군훈련 받으러 가야 하는데 밥까지 내 돈 주고 사먹어야 하냐…",
