		"id_str": "838547231238037505",
		"text": "저 분 예전에는 자기 주변의 친한 남자 모임들에 가면 (나 빼고) 툭하면 성매매 가자고 한다고 하지 않았었나? 그래서 사람들이 그런델 왜 계속 나가냐고 노이해했는데, 갑자기 태세 전환해서 내 주변 친한 남자 모임들은 성매매 이야기 안한다고 하시네… 음",
