		"text": "탐라를 보다보면 판결 관련 뉴스를 링크한 뒤 '왜 범죄자를 집행유예 했느냐, 왜 형을 이렇게 약하게 선고했냐, 범죄자 친화적' 식의 트윗들을 매우 높은 빈도로 볼 수 있는데, 재판부가 당사자간의 합의를 반영하여 양형했는 기사 내용은 대부분 무시되는 편",
