		"geo": {},
		"id_str": "837157623044562944",
		"in_reply_to_user_id": 95255804,
		"text": "그런 식으로 대응을 하는 것부터가 그 샤대 수치심 그랜드 마스터와 똑같은 가치관을 가진- 학력이나 백분위 등을 통해 서열을 매기고, 서열이 낮은 사람은 높은 사람 밑에서 닥치고 따르라는 가치관을 가진 인간이라는 인증밖에 더 되겠나.",
