		"text": "엊그제 그 샤대 그랜드마스터(…) 수치심 사건 이후로 '더 잘난 누구누구도 XX인데…' 류의 글들이 자꾸 눈에 띄는데, 그런 식으로 따지기 시작하면 세계 랭킹 1위 찾아서 그 사람의 스탠스를 검증하면 우리 모두가 거기에 따라야 함… 참 의미없는 대응.",
