		"geo": {},
		"id_str": "836979088891924481",
		"in_reply_to_user_id": 95255804,
		"text": "어릴 때에는 동네에 함께 놀 내 또래 아이들이 거의 없었고, 부모님께서 TV도 못보게 하셔서 학교 다녀오면 그저 손에 잡히는대로 책만 읽음. 그러다보니 나 혼자서 속독하는 법을 배우게 되더라. 못해도 한 달에 대충 100권 정도씩은 읽었던 것 같은데…",
		"id": 836979088891924500,
