		"id_str": "836978283094798337",
		"text": "나 어릴 때 부모님께서 사주셨던 유일한 장난감이 레고였음… 그 외에는 장난감을 가져본 적이 없고, 대신 책은 늘 넘쳐남. 집 바로 옆에 큰 서점이 있었는데, 매일같이 거기서 책 읽으면서 놀고, 가지고 싶은 책을 카운터에 말하고 가져오면 월말에 청구받음",
